import React ,{useRef} from 'react'
import {Line} from 'react-chartjs-components'

const Chart = () => {
    const  ref = useRef();
    return (
        <div>
            <Line ref={ref}  data={
              {
                labels:  ['felipe','sergio','shin'],
                datasets:  [{
                    label: 'mariguana',
                        data: [1,2,3],
                        borderColor: 'rgba(255, 159, 64, 0.7)',
                        backgroundColor:'rgba(255, 159, 64, 0.1)',
                }] 
              }

            } with={200} heidth={100}/> 
                
        </div>  
    )
}

export default Chart
